			"originalText": "(As this Saga enters and after your draw step, add a lore counter.)I  Return up to one target creature or planeswalker to its owners hand.II  Return an artifact card from your graveyard to your hand. If you cant, draw a card.III  Exile this Saga, then return it to the battlefield transformed under your control.",
