			"name": "Ogre-Head Helm",
			"number": "155",
			"originalText": "Equipped creature gets +2/+2.Whenever Ogre-Head Helm or equipped creature deals combat damage to a player, you may sacrifice it. If you do, discard your hand, then draw three cards.Reconfigure {3} ({3}: Attach to target creature you control; or unattach from a creature. Reconfigure only as a sorcery. While attached, this isnt a creature.)",
