			"name": "Cloudsteel Kirin",
			"number": "435",
			"originalText": "FlyingEquipped creature has flying and You cant lose the game and your opponents cant win the game.Reconfigure {5}",
			"originalType": "Artifact Creature  Equipment Kirin",
