			"number": "448",
			"originalText": "FlyingWhenever Mindlink Mech becomes crewed for the first time each turn, until end of turn, Mindlink Mech becomes a copy of target nonlegendary creature that crewed it this turn, except its 4/3, its a Vehicle artifact in addition to its other types, and it has flying.Crew 1",
